import React from "react";
import { Link } from "react-router-dom";

const MensagemLogin = ({ isLoggedIn }) => {
  return (
    <div>
      {isLoggedIn ? (
        <p>Usuário logado com sucesso!</p>
      ) : (
        <p>
          Não tem uma conta? <Link to="/cadastroUsuario">Cadastre-se aqui</Link>
        </p>
      )}
    </div>
  );
};

export default MensagemLogin;
